import React from "react";
import styles from "../assets/css/about.module.css";

import AboutAx from "../assets/img/aboutus.webp";

const About = () => {
  const { about } = styles;
  return (
    <section className={about}>
      <img src={AboutAx} alt="about_us" />
    </section>
  );
};

export default About;
